import React from "react";
import { Footer, Features, WhatGPT3, Header } from "./Container";
import { Brand, Navbar } from "./Components";
import "./App.css";
import homebb from "./assets/homebb.png";

function App() {
  return (
    <div className="App">
      <div className="gradient__bg">
        <Navbar />
        <Header />
      </div>
      <Brand />
      <WhatGPT3 />
      <Features />
      <Possibility />
      <Cta />
      <Blog />
      <Footer />
    </div>
  );
}

export default App;
